{
  "Firm Name" : "DEAN WITTER",
  "Termination Type" : "Discharged",
  "Allegations" : "IN AN ATTEMPT TO EXPEDITE THE TRANSFER OF A LONG-TIME CLIENT'S 65 SHARES OF PACIFIC TELESIS COMMON STOCK, HE DRAFTED A LETTER TO THE STOCK TRANSFER AGENT REQUESTING THAT THE HOLD ON THE CERTIFICATE BE REMOVED.  THE CLIENT HAD EXPRESSED TO HIM ON SERVERAL OCCASIONS THE URGENCY TO IMMEDIATELY LIQUIDATE HER SHARES OF PAC TEL.  HOWEVER, THE CLIENT WAS UNAVAILABLE FOR SEVERAL DAYS AND HE HAD NO WAY OF GETTTING THE DOCUMENT TO HER FOR A SIGNATURE.  THEREFORE, HE SIGNED THE CUSTOMER'S NAME TO THE LETTER AND MAILED IT TO THE TRANSFER AGENT.  THE HOLD ON THE STOCK WAS RELEASED, THE SALE OF THE SHARES OF STOCK PROCEEDED WITHOUT INCIDENT, AND THE CLIENT RECEIVED HER MONEY IN A TIMELY MANNER.  HOWEVER, KNOWING HIS ERROR IN JUDGEMENT AND WANTING TO PROTECT THE FIRMS' GOOD NAME, HE NOTIFIED HIS MANAGER OF WHAT HAD TRANSPIRED."
}
